import { Heading, Box, Image } from "@chakra-ui/react";

function App() {
  return (
    <Box bg="black" h="100vh" d="flex" alignItems="center" justifyContent="center">
      <Box textAlign="center">
        <Heading color="white" mb={4}>
          Draw my face
        </Heading>
        <Image src="https://via.placeholder.com/512x512" alt="placeholder image" />
      </Box>
    </Box>
  );
}

export default App;
